import { Menu, Transition } from "@headlessui/react";
import { signOut, useSession } from "next-auth/react";

import { Fragment } from "react";
import Image from "next/image";
import Link from "next/link";
import cn from "classnames";

export const UserMenu = () => {
  const { data } = useSession();
  const user = data?.user;

  return (
    <Menu as="div">
      <Menu.Button className="flex rounded-full bg-gray-800 text-sm focus:outline-none focus:ring-2 focus:ring-white focus:ring-offset-2 focus:ring-offset-gray-800">
        <span className="sr-only">Open user menu</span>
        {/* TODO: Convert to proper Avatar component with fallback to user initials graceful failing */}
        <Image
          alt={`Profile picture of ${user?.name}`}
          className="rounded-full"
          height={32}
          src="data:image/png;base64,"
          width={32}
        />
      </Menu.Button>
      <Transition
        as={Fragment}
        enter="transition ease-out duration-100"
        enterFrom="transform opacity-0 scale-95"
        enterTo="transform opacity-100 scale-100"
        leave="transition ease-in duration-75"
        leaveFrom="transform opacity-100 scale-100"
        leaveTo="transform opacity-0 scale-95"
      >
        <Menu.Items className="absolute right-0 mt-2 w-48 origin-top-right rounded-md bg-white py-1 text-sm text-zinc-900 shadow-lg ring-1 ring-zinc-400/20 focus:outline-none dark:bg-zinc-900 dark:text-white">
          <Menu.Item>
            {({ active }) => (
              <div>
                <Link href="/account" passHref>
                  <a
                    className={cn(
                      active ? "bg-zinc-100 dark:bg-zinc-800" : "",
                      "block px-4 py-2 hover:cursor-pointer"
                    )}
                  >
                    Settings
                  </a>
                </Link>
              </div>
            )}
          </Menu.Item>
          <Menu.Item>
            {({ active }) => (
              <div
                className={cn(
                  active ? "bg-zinc-100 dark:bg-zinc-800" : "",
                  "block px-4 py-2 hover:cursor-pointer"
                )}
                onClick={() => signOut()}
                role="button"
              >
                Sign out
              </div>
            )}
          </Menu.Item>
        </Menu.Items>
      </Transition>
    </Menu>
  );
};
